// Test with multiple organizations
const createMultipleOrgs = async () => {
  const orgs = [];
  for (let i = 0; i < 10; i++) {
    const org = await organizationService.createOrganization({
      name: `Test Org ${i}`,
      slug: `test-org-${i}`,
      subscription_plan: 'team'
    });
    orgs.push(org);
